<script type="text/javascript">
var gaiaBubble = new gaia.Bubble();
gaiaBubble.disableJfk = false;
gaiaBubble.position = jfk.PopupPosition.LEFT;
var newInputHolder = function(id, jfkInput) {
  if (document.getElementById(id)) {
  return new InputHolder(id, jfkInput);
  }
};
var InputHolder = function(id, jfkInput) {
  var input = document.getElementById(id);
  this.inputForId = input;
  if (jfkInput) {
  this.inputForValue = document.getElementById('Hidden' + id);
  this.inputForEvents = jfkInput.getElement();
  } else {
  this.inputForValue = input;
  this.inputForEvents = input;
  }
  this.prevalidationHandlers = [];
  this.error = document.getElementById('errormsg_0_' + id);
  var inputHolder = this;
  this.attachRemoveErrorHandler(function() {
  inputHolder.clearErrorMessage();
  });
}
InputHolder.prototype.id = function() {
  return this.inputForId.id;
};
InputHolder.prototype.value = function() {
  return this.inputForValue.value;
};
InputHolder.prototype.attachEvent = function(event, handler) {
  gaia_attachEvent(this.inputForEvents, event, handler, false);
};
InputHolder.prototype.attachPrevalidationHandler = function(handler) {
  this.prevalidationHandlers.push(handler);
};
InputHolder.prototype.attachValidationHandler = function(handler) {
  this.attachEvent('blur', handler);
};
InputHolder.prototype.attachRemoveErrorHandler = function(handler) {
  this.attachEvent('focus', handler);
  this.attachEvent('keydown', handler);
  this.attachEvent('click', handler);
};
InputHolder.prototype.attachRemoveDuplicateErrorsHandler = function(handler) {
  this.removeDuplicateErrorsHandler = handler;
};
InputHolder.prototype.setInfoMessage = function(messageId, anchorId) {
  var message = document.getElementById(messageId);
  if (gaiaBubble.disableJfk) {
  this.attachEvent('focus', function() {
  message.style.display = 'block';
  });
  this.attachEvent('keyup', function() {
  message.style.display = 'block';
  });
  } else {
  var anchorNode = this.inputForEvents.parentNode;
  if (anchorId) {
  anchorNode = document.getElementById(anchorId);
  }
  while (anchorNode) {
  var anchorNodeStyle = anchorNode.currentStyle ||
  window.getComputedStyle(anchorNode, '');
  if (anchorNodeStyle && (anchorNodeStyle.display == 'block' ||
  anchorNodeStyle.display == 'inline-block')) {
  break;
  }
  anchorNode = anchorNode.parentNode;
  }
  if (!anchorNode) {
  anchorNode = this.inputForEvents.parentNode;
  }
  gaiaBubble.init(this.inputForEvents, message, anchorNode, gaiaBubble.position);
  message.parentNode.removeChild(message);
  }
};
InputHolder.prototype.setPlaceHolder = function(placeHolderId) {
  var placeHolder = document.getElementById(placeHolderId);
  var inputForValue = this.inputForValue;
  if (!inputForValue.value) {
  placeHolder.style.display = 'block';
  }
  this.attachEvent('keydown', function() {
  placeHolder.style.display = 'none';
  });
  // Clear hint text when user pastes a value using right-click menu.
  this.attachEvent('input', function() {
  if (!inputForValue.value) {
  placeHolder.style.display = 'block';
  } else {
  placeHolder.style.display = 'none';
  }
  });
  this.attachEvent('blur', function() {
  if (!inputForValue.value) {
  placeHolder.style.display = 'block';
  }
  });
};
InputHolder.prototype.setHandler = function(handler) {
  gaia_attachEvent(this.inputForEvents, 'blur', handler, false);
};
InputHolder.prototype.hasErrorMessage = function() {
  if (gaia_hasInnerTextProperty) {
  return this.error.innerText.replace(/\s*/, '').length > 0;
  } else {
  return this.error.textContent.replace(/\s*/, '').length > 0;
  }
};
InputHolder.prototype.getErrorMessage = function() {
  return this.error.innerHTML;
};
InputHolder.prototype.setError = function(error) {
  if (typeof(error) == 'string') {
  this.setErrorMessage(error);
  } else if (error.nodeType) {
  this.setErrorMessage(error.innerHTML);
  } else if (error[this.id()]) {
  this.setErrorMessage(error[this.id()]);
  }
};
InputHolder.prototype.setErrorMessage = function(message) {
  this.inputForId.className = this.inputForId.className + ' form-error';
  this.inputForId.setAttribute('aria-invalid', 'true');
  this.error.style.display = '';
  this.error.innerHTML = message;
  if (this.removeDuplicateErrorsHandler) {
  this.removeDuplicateErrorsHandler(this);
  }
  // Update info bubble position in case the anchor element has shifted due to
  // display of an error message.
  gaiaBubble.reposition();
};
InputHolder.prototype.clearErrorMessage = function() {
  this.error.innerHTML = '';
  var input = this.inputForId;
  if (input.className) {
  var indexOfFormError = input.className.indexOf('form-error');
  if (indexOfFormError >= 0) {
  input.className = input.className.substring(0, indexOfFormError);
  }
  }
  if (input.getAttribute('aria-invalid')) {
  input.setAttribute('aria-invalid', 'false');
  }
};
InputHolder.prototype.isNullOrEmpty = function() {
  return (this.inputForValue.value == null || this.inputForValue.value == "");
};
InputHolder.prototype.prefill = function() {
  try {
  if (this.isNullOrEmpty() && location.hash) {
  var params = decodeURIComponent(location.hash.substring(1)).split('&');
  for (var i = 0; i < params.length; i++) {
        var param = params[i].split('=');
        if (this.id() == param[0] && param[1]) {
          this.inputForValue.value = param[1];
          return;
        }
      }
    }
  } catch (e) {}
};






var gaia_initPasswordStrengthMeter = function(inputHolders, ratingMessages) {
  inputHolders.passwd.previousValue = '';
  inputHolders.passwd.attachEvent('keyup', inputHandler);
  inputHolders.passwd.attachEvent('focus', inputHandler);
  inputHolders.passwd.setInfoMessage('password-infomessage');

  function inputHandler() {
    if (inputHolders.passwd.value().length < 8) {
      updatePasswordBar(0);
      inputHolders.passwd.previousValue = inputHolders.passwd.value();
    } else if (inputHolders.passwd.value() != inputHolders.passwd.previousValue) {
      var request = new gaia.ajax.XmlHttpFormRequest();
      request.parameters['Passwd'] = inputHolders.passwd.value();
      if (inputHolders.gmailAddress) {
        request.parameters['Email'] = inputHolders.gmailAddress.value();
      }
      if (inputHolders.firstName && inputHolders.lastName) {
        request.parameters['FirstName'] = inputHolders.firstName.value();
        request.parameters['LastName'] = inputHolders.lastName.value();
      }
      request.send('RatePassword', function(response) {
        updatePasswordBar(response.text);
      });
      inputHolders.passwd.previousValue = inputHolders.passwd.value();
    }
  }

  function updatePasswordBar(rating) {
    var ratingClasses = new Array(6);
    ratingClasses[0] = 'short';
    ratingClasses[1] = 'weak';
    ratingClasses[2] = 'fair';
    ratingClasses[3] = 'good';
    ratingClasses[4] = 'strong';
    ratingClasses[5] = 'notRated';

    var bar = document.getElementById('strength-bar');
    if (bar) { 
      var message = document.getElementById('passwdRating');
      var barLength = document.getElementById('passwdBar').clientWidth;
      bar.className = ratingClasses[rating];
      if (rating >= 0 && rating <= 4) {  
        bar.style.width  = (barLength * (parseInt(rating) + 1.0) / 5.0) + 'px';
        message.innerHTML = ratingMessages[rating];
      } else {
        bar.style.width = 0;
        rating = 5; 
      }
    }
  }
};





function registerValidationHandler(inputs,
                                   validateInputFunction,
                                   getValuesAsJsonFunction,
                                   handleValidationResponseFunction) {

  function handleValidationResponse(errors, data) {
    for (var i = 0; i < inputs.length; i++) {
      inputs[i].setError(errors);
    }
  }

  function validate(input) {
    
    var running = false;
    return function() {
      try {
        for (var i = 0; i < input.prevalidationHandlers.length; i++) {
          input.prevalidationHandlers[i]();
        }
        if (!validateInputFunction(input)) {
          return;
        }
        for (var i = 0; i < inputs.length; i++) {
          if (inputs[i].isNullOrEmpty()) {
            return;
          }
        }
        if (input.hasErrorMessage() || running) {
          return;
        }
        running = true;
        if (getValuesAsJsonFunction) {
          var valuesAsJson = getValuesAsJsonFunction();
          if (valuesAsJson) {
            var validator = new gaia.InputValidator('SignUp');
            validator.locale = 'en';
            validator.service = '';
            if (handleValidationResponseFunction) {
              validator.errorHandler = handleValidationResponseFunction;
            } else {
              validator.errorHandler = function(errors, data) {
                handleValidationResponse(errors, data);
              };
            }
              validator.validate(valuesAsJson);
          }
        }
      } finally {
        running = false;
      }
    };
  }

  function validateOnSubmit(input, validationFunction) {
    return function() {
      validationFunction();
      return !input.hasErrorMessage();
    }
  }

  for (var i = 0; i < inputs.length; i++) {
    var input = inputs[i];
    var validationFunction = validate(input);
    input.attachValidationHandler(validationFunction);
    gaia_addOnSubmitValidationHandler(
        input.id(), validateOnSubmit(input, validationFunction));
  }

}

function getFirstInputWithError(inputs) {
  for (var i = 0; i < inputs.length; i++) {
    if (inputs[i].hasErrorMessage()) {
      return inputs[i];
    }
  }
}

function removeDuplicateErrorMessages(input, inputs) {
  if (input && input.hasErrorMessage()) {
    var thisErrorMessage = input.getErrorMessage();
    for (var i = 0; i < inputs.length; i++) {
      if (inputs[i].id() != input.id()) {
        if (thisErrorMessage == inputs[i].getErrorMessage()) {
          inputs[i].error.style.display = 'none';
        }
      }
    }
  }
}

function registerRemoveDuplicateErrorMessagesHandler(inputs) {
  for (var i = 0; i < inputs.length; i++) {
    inputs[i].attachRemoveDuplicateErrorsHandler(function(input) {
      removeDuplicateErrorMessages(input, inputs);
    });
  }
}

</script>
<script type="text/javascript">
  gaiaBubble.position = jfk.PopupPosition.LEFT;
  var inputHolders = new function() {
  var jfkBirthMonthMenu = birthMonthMenu;
  var jfkGenderMenu = genderMenu;
  var jfkCountryCodeMenu = countryCodeMenu;
  this.firstName = newInputHolder('FirstName');
  this.lastName = newInputHolder('LastName');
  this.emailAddress = newInputHolder('EmailAddress');
  this.gmailAddress = newInputHolder('GmailAddress');
  this.passwd = newInputHolder('Passwd');
  this.passwdAgain = newInputHolder('PasswdAgain');
  this.birthMonth = newInputHolder('BirthMonth', jfkBirthMonthMenu);
  this.birthDay = newInputHolder('BirthDay');
  this.birthYear = newInputHolder('BirthYear');
  this.gender = newInputHolder('Gender', jfkGenderMenu);
  this.recoveryPhone = newInputHolder('RecoveryPhoneNumber');
  this.recoveryEmail = newInputHolder('RecoveryEmailAddress');
  this.countryCode = newInputHolder('CountryCode', jfkCountryCodeMenu);
  this.termsOfService = newInputHolder('TermsOfService');
  };
  var nameFormats = {
  'firstname' : inputHolders.firstName,
  'lastname' : inputHolders.lastName};
  var nameInputs = [
  nameFormats['firstname'],
  nameFormats['lastname']];
  inputHolders.firstName.prefill();
  inputHolders.lastName.prefill();
  inputHolders.firstName.setPlaceHolder('firstname-placeholder');
  inputHolders.lastName.setPlaceHolder('lastname-placeholder');
  nameInputs[0].setInfoMessage('name-infomessage');
  if (inputHolders.gmailAddress) {
  inputHolders.gmailAddress.prefill();
  inputHolders.gmailAddress.setInfoMessage('gmail-address-infomessage');
  }
  if (inputHolders.emailAddress) {
  inputHolders.emailAddress.prefill();
  inputHolders.emailAddress.setInfoMessage('email-address-infomessage');
  }
  gaia_initPasswordStrengthMeter(inputHolders, [
  "Too short",
  "Weak",
  "Fair",
  "Good",
  "Strong",
  "Not rated"
  ]);
  inputHolders.passwdAgain.attachEvent('focus', function() {
  gaiaBubble.hideInfoBubble();
  });
  var birthDateFormats = {
  'day' : inputHolders.birthDay,
  'month' : inputHolders.birthMonth,
  'year' : inputHolders.birthYear};
  var birthDateInputs = [
  birthDateFormats['month'],
  birthDateFormats['day'],
  birthDateFormats['year']];
  inputHolders.birthDay.setPlaceHolder('birthday-placeholder');
  inputHolders.birthYear.setPlaceHolder('birthyear-placeholder');
  birthDateInputs[0].setInfoMessage('birthday-infomessage');
  if (inputHolders.recoveryPhone) {
  inputHolders.recoveryPhone.setInfoMessage('phone-infomessage');
  }
  if (inputHolders.recoveryEmail) {
  inputHolders.recoveryEmail.prefill();
  inputHolders.recoveryEmail.setInfoMessage('recovery-email-infomessage');
  }
  inputHolders.countryCode.setInfoMessage('country-code-infomessage');
  var gaia_initValidation = function() {
  var inputEmptyErrorMessage =
  'You can\x27t leave this empty.';
  function defaultValidateInputFunction() {
  return function(input) {
  if (input.isNullOrEmpty()) {
  input.setErrorMessage(inputEmptyErrorMessage);
  return false;
  }
  return true;
  };
  }
  function defaultGetValuesAsJsonFunction(name, inputHolders) {
  return function() {
  var json = {};
  json['Input'] = name;
  for (var i = 0; i < inputHolders.length; i++) {
          json[inputHolders[i].id()] = inputHolders[i].value();
        }
        return json;
      };
    }

    registerValidationHandler(
        nameInputs,
        defaultValidateInputFunction());
    registerRemoveDuplicateErrorMessagesHandler(nameInputs);
    removeDuplicateErrorMessages(getFirstInputWithError(nameInputs), nameInputs)

    registerValidationHandler(
        [inputHolders.passwd],
        defaultValidateInputFunction(),
        function() {
          var json = {};
          json['Input'] = 'Passwd';
          
          json[inputHolders.passwd.id()] = inputHolders.passwd.value();
          json[inputHolders.passwdAgain.id()] = inputHolders.passwd.value();
          json[inputHolders.firstName.id()] = inputHolders.firstName.value();
          json[inputHolders.lastName.id()] = inputHolders.lastName.value();
          if (inputHolders.gmailAddress) {
            json[inputHolders.gmailAddress.id()] = inputHolders.gmailAddress.value();
          }
          if (inputHolders.emailAddress) {
            json[inputHolders.emailAddress.id()] = inputHolders.emailAddress.value();
          }
          return json;
        });

    registerValidationHandler(
        [inputHolders.passwdAgain],
        function(input) {
          if (inputHolders.passwd.isNullOrEmpty() && inputHolders.passwdAgain.isNullOrEmpty()) {
            inputHolders.passwdAgain.setErrorMessage(inputEmptyErrorMessage);
            return false;
          }
          if (inputHolders.passwd.value() != inputHolders.passwdAgain.value()) {
            inputHolders.passwdAgain.setErrorMessage('These passwords don\x27t match. Try again?');
            return false;
          }
          return true;
        });

    
    inputHolders.passwd.attachEvent('keydown',
      function(event) {
        event = event || window.event;
        var keycode = event.charCode || event.keyCode;
        
        if (keycode != 9) {
          inputHolders.passwdAgain.clearErrorMessage();
          inputHolders.passwdAgain.inputForValue.value = '';
        }
      });

    registerValidationHandler(
        birthDateInputs,
        defaultValidateInputFunction(),
        defaultGetValuesAsJsonFunction('Birthday', birthDateInputs));
    registerRemoveDuplicateErrorMessagesHandler(birthDateInputs);
    removeDuplicateErrorMessages(getFirstInputWithError(birthDateInputs), birthDateInputs);


    if (inputHolders.gender) {
      registerValidationHandler(
          [inputHolders.gender],
          defaultValidateInputFunction());
    }

    if (inputHolders.recoveryPhone) {
      registerValidationHandler(
          [inputHolders.recoveryPhone],
          function(input) {
            return gaia_getNonDefaultPhoneInputValue() ? true : false;
          },
          function() {
            var countryInput = document.getElementById('RecoveryPhoneCountry');
            return {
              'Input' : 'RecoveryPhoneNumber',
              'RecoveryPhoneNumber' : gaia_getNonDefaultPhoneInputValue(),
              'RecoveryPhoneCountry' : countryInput.value
            }
          });
    }

    if (inputHolders.recoveryEmail) {
      registerValidationHandler(
          [inputHolders.recoveryEmail],
          function(input) {
            return !input.isNullOrEmpty();
          },
          defaultGetValuesAsJsonFunction('RecoveryEmailAddress', [inputHolders.recoveryEmail, inputHolders.gmailAddress]));
    }

    if (inputHolders.emailAddress) {
      registerValidationHandler(
          [inputHolders.emailAddress],
          defaultValidateInputFunction(),
          defaultGetValuesAsJsonFunction('EmailAddress', [inputHolders.emailAddress]),
          function(errors, data) {
            if (errors[inputHolders.emailAddress.id()]) {
              var error = errors[inputHolders.emailAddress.id()];
              if (error ==
                  'A user with the email address you specified already exists') {
                error = promoteUserToLoginErrorMessage(
                            document.getElementById('EmailAddressExistsError'),
                            inputHolders.emailAddress.value());
              }
              inputHolders.emailAddress.setError(error);
            }
          });
    }

    if (inputHolders.gmailAddress) {
      var gmailAddressErrormsgAndSuggestionsDiv = document.getElementById('username-errormsg-and-suggestions');
      var gmailAddressSuggestionsDiv = document.getElementById('username-suggestions');
      registerValidationHandler(
          [inputHolders.gmailAddress],
          defaultValidateInputFunction(),
          defaultGetValuesAsJsonFunction('GmailAddress', [inputHolders.gmailAddress, inputHolders.firstName, inputHolders.lastName]),
          function(errors, data) {
            var error = errors[inputHolders.gmailAddress.id()];
            if (error == 'You entered an email address that is already associated with an account.' ) {
              errors = promoteUserToLoginErrorMessage(
                          document.getElementById('EmailAddressExistsError'),
                          inputHolders.gmailAddress.value());
            }
            inputHolders.gmailAddress.setError(errors);
            gmailAddressErrormsgAndSuggestionsDiv.style.display = '';
            gmailAddressErrormsgAndSuggestionsDiv.setAttribute('role', 'alert');
            var suggestions = data;
            if (typeof(suggestions) == 'string') {
              suggestions = eval('(' + suggestions + ')');
            }
            if (suggestions.length > 0) {
  gmailAddressSuggestionsDiv.style.display = 'block';
  gmailAddressSuggestionsDiv.innerHTML = 'Available: ';
  for (var i = 0; i < Math.min(suggestions.length, 3); i++) {
                var anchor = document.createElement('a');
                anchor.innerHTML = suggestions[i];
                anchor.href = '';
                anchor.onclick = selectUsernameSuggestionFunction(suggestions[i]);
                gmailAddressSuggestionsDiv.appendChild(anchor);
              }
            }
          });

      function promoteUserToLoginErrorMessage(error, emailAddress) {
        var anchors = error.getElementsByTagName('a');
        for (var i = 0; i < anchors.length; i++) {
          if (anchors[i].href.indexOf('/ServiceLogin') > 0) {
  anchors[i].href = gaia.uri.setFragmentParam(
  anchors[i].href, 'Email', emailAddress);
  } else {
  anchors[i].href = gaia.uri.setParam(
  anchors[i].href, 'Email', emailAddress);
  }
  }
  return error;
  }
  function selectUsernameSuggestionFunction(username) {
  return function() {
  inputHolders.gmailAddress.inputForValue.focus();
  inputHolders.gmailAddress.inputForValue.value = username;
  gmailAddressErrormsgAndSuggestionsDiv.style.display = 'none';
  return false;
  };
  }
  inputHolders.gmailAddress.attachRemoveErrorHandler(function() {
  gmailAddressSuggestionsDiv.style.display = 'none';
  });
  inputHolders.gmailAddress.attachPrevalidationHandler(function() {
  var username = inputHolders.gmailAddress.inputForValue.value;
