<script type="text/javascript">
  var gaia_renderBirthDayAndYear = function() {
  var renderBirthDateField = function(inputId, placeholderId,
  selectedValue, hasError, begin, end) {
  function addOption(select, i, selectedValue) {
  var option = document.createElement('option');
  option.setAttribute('value', i);
  option.innerHTML = i;
  if (selectedValue == option.value) {
  option.selected = true;
  }
  select.appendChild(option);
  }
  var placeholder = document.getElementById(placeholderId);
  var select = document.createElement('select');
  select.setAttribute('id', inputId);
  select.setAttribute('name', inputId);
  var option = document.createElement('option');
  option.setAttribute('value', '');
  option.innerHTML = placeholder.innerHTML;
  select.appendChild(option);
  if (begin < end) {
        for (var i = begin; i <= end; i++) {
          addOption(select, i, selectedValue);
        }
      } else {
        for (var i = begin; i >= end; i--) {
  addOption(select, i, selectedValue);
  }
  }
  if (hasError) {
  select.className = "form-error";
  }
  var input = document.getElementById(inputId);
  var inputParent = input.parentNode;
  inputParent.insertBefore(select, input);
  inputParent.removeChild(input);
  inputParent.removeChild(placeholder);
  };
  var hasError = false;
  var begin = 1;
  var end = 31;
  renderBirthDateField('BirthDay', 'birthday-placeholder',
  "", hasError, begin, end);
  inputHolders.birthDay = new InputHolder('BirthDay');
  hasError = false;
  var currentYear = new Date().getFullYear();
  begin = currentYear;
  end = currentYear - 150;
  renderBirthDateField('BirthYear', 'birthyear-placeholder',
  "", hasError, begin, end);
  inputHolders.birthYear = new InputHolder('BirthYear');
  };
